import './header.css';
import {AuthContext} from '../../contexts/auth';
import { useContext } from 'react';

export default function Header (){
  const {user} = useContext(AuthContext);
  
  return(
    <div className='navbar'>
      <h1>header</h1>
      <span>{user.email}</span>
    </div>
  )
}
